import React, { Component } from 'react';
import './effect.css';

class Demande extends Component {
    constructor(props){
        super(props);
        this.state ={
            isLoading : true,
            projects:[]
        }
    }

    componentDidMount(){
        this.fetchData();
    }

    fetchData(){
        fetch('http://127.0.0.1:8000/api/projet/get/top')
        .then(response => response.json())
        .then(parsedJSON => parsedJSON.data.map(proj => (
            {
                titre : `${proj.titre}`,
                projet_id : `${proj.projet_id}`,
            }
            )))
        .then(projects => this.setState({
            projects,
            isLoading: false
        }))
        .catch(error => console.log('parsing failed', error))
    }



    render() { 
        return ( 
            <div className="grid">
                <figure className="effect-sadie">
                    <img src="https://picsum.photos/640/360" alt="img02" />
                    <figcaption>
                        <h2></h2>
                        <p>Sadie never took her eyes off me. She had a dark soul.</p>
                        <a href="#demande">View more</a>
                    </figcaption>
                </figure>
            </div>

         );
    }
}
 
export default Demande;
